import React from 'react';
import './App.css';
import Star from './components/Star';
import { Button, Container, Col, Row, Jumbotron } from 'react-bootstrap';

function App() {
  return (
    <Container>
      <Jumbotron>
        <h1>React Dash Stars App</h1>
      </Jumbotron>
      <Row>
        <Col>
        <Star color="{red}"/>
        <Star color="{yellow}"/>
        <Star color="{blue}"/>
        <Star color="{gray}"/>
        </Col>
      </Row>     
    </Container>
  );
}

export default App;
